import avatar4 from "../assets/img/avatars/avatar-4.jpg";
import avatar5 from "../assets/img/avatars/avatar-5.jpg";



class NavbarComponent extends React.Component{
  constructor(props){
    super(props)
  }
  render(){
    console.log(this.props)
    return(
      <div></div>
    )
  }
}


function mapStateToProps(state) {
